package application;

public class Students1 {
	
	private int id;
	private String username;
	private String password;
	private String nom;
	private String prènom;
	private String filière;
	private String contact;
	private int idbinome;
	private int idencadtant;
	private int idreunion;
	private int idsujet;
	private int idsoutenance;
	public Students1() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Students1(int id, String nom, String prènom, String filière, String contact) {
		super();
		this.id = id;
		this.nom = nom;
		this.prènom = prènom;
		this.filière = filière;
		this.contact = contact;
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getUsername() {
		return username;
	}
	public void setUsername(String username) {
		this.username = username;
	}
	public String getPassword() {
		return password;
	}
	public void setPassword(String password) {
		this.password = password;
	}
	public String getNom() {
		return nom;
	}
	public void setNom(String nom) {
		this.nom = nom;
	}
	public String getPrènom() {
		return prènom;
	}
	public void setPrènom(String prènom) {
		this.prènom = prènom;
	}
	public String getFilière() {
		return filière;
	}
	public void setFilière(String filière) {
		this.filière = filière;
	}
	public String getContact() {
		return contact;
	}
	public void setContact(String contact) {
		this.contact = contact;
	}
	public int getIdbinome() {
		return idbinome;
	}
	public void setIdbinome(int idbinome) {
		this.idbinome = idbinome;
	}
	public int getIdencadtant() {
		return idencadtant;
	}
	public void setIdencadtant(int idencadtant) {
		this.idencadtant = idencadtant;
	}
	public int getIdreunion() {
		return idreunion;
	}
	public void setIdreunion(int idreunion) {
		this.idreunion = idreunion;
	}
	public int getIdsujet() {
		return idsujet;
	}
	public void setIdsujet(int idsujet) {
		this.idsujet = idsujet;
	}
	public int getIdsoutenance() {
		return idsoutenance;
	}
	public void setIdsoutenance(int idsoutenance) {
		this.idsoutenance = idsoutenance;
	}
	
	
	
	
	
}
